import './Dashboard.css';
import React, { useState } from "react";
import Nutcracker from "./test.mp3";
import ReactDOM from 'react-dom';
import Modal from 'react-modal';
import Button from 'react-bootstrap/Button';

Modal.setAppElement("#MoveCont"); 

export default function Dashboard() {
let audio = new Audio("./test.mp3")
const start = () => {
    audio.play()

}

const [isOpen, setIsOpen] = useState(false); // modal
function toggleModal() {
    setIsOpen(!isOpen);
 }



    return (
    	<div id = "Dash">
    		<div id = "Moves"> 
	    		<div id = "MovesList">
	    			<div id = "MoveCont">
		    			<div id = "Move"> Move 1 </div>

		    			<button onClick = {toggleModal}> + </button>
		    			      <Modal
						        isOpen={isOpen}
						        onRequestClose={toggleModal}
						        contentLabel="My dialog"
						        className="mymodal"
						        overlayClassName="myoverlay"
						        closeTimeoutMS={500}
						      >
						      	<div>Move 1</div>
						        <button onClick={toggleModal}>Close modal</button>
						      </Modal>
	    			</div>

	    		</div>

    			<button id = "AddMove"> + Add Move </button>


    		</div>
    		<div id = "Panel">
    			<div id = "Grid"> </div>
    			<div id = "Judges"> Judging Panel </div>
    			<div id = "MusicPanel">
    				<button id = "UploadMusic"> Upload Music </button>
	    			<audio src= {Nutcracker} controls = {true} id = "MusicPlayer">
	                    <source  type="audio/mp3"/>
	                    Your browser does not support the audio tag.
	                </audio>
                </div>
    		</div>
    	</div>
    );
}
